import React from "react";
import ReactDOM from "react-dom";
import App from './views/App'
import "./index.css";

import { Provider } from "react-redux"
import store from "./store/store"

ReactDOM.render(
  <Provider store={store}>
    <React.StrictMode>
     <App/>
    </React.StrictMode>
  </Provider>,
  document.getElementById("root")
);
